import React from 'react'
import {CarousalData } from './CarousalData'

 const Carousal = () => {
  return (
    <div>
      {CarousalData.map((slide,i)=>{
        return <img src={slide.image} alt='random pic' />;
      })}
    </div>
  )
}
export default Carousal
